import React from 'react';
import styled from 'styled-components';

const AlertBox = styled.label`
	width: 15em;
	height: 3em;
	color: red;
	transition: font 0.5s;
`;
const alert = () => {
	return (
		<div>
			<AlertBox></AlertBox>
		</div>
	);
};

export default alert;
